import React from "react";

const Box = ({ iconClass, h6Text, pText = "" , src="" }) => {
  return (
    <div className="col-md-3 col-sm-6">
      <div className="single-place">
        <i className={iconClass} />
        <h6>{h6Text}</h6>
        <p>{pText}</p>
        src ?
        <img src={item.src} />
      </div>
    </div>
  );
};

export default Box;
